import React, { Component } from "react";
import ReactDOM from "react-dom";

class Search extends Component {
  state = {};
  constructor(props) {
    super(props);
    this.state = { username: "" };
  }
  mySubmitHandler = event => {
    event.preventDefault();
    alert("You are submitting " + this.state.username);
  };
  myChangeHandler = event => {
    alert("You are submitting ");
    this.setState({ username: event.target.value });
  };
  render() {
    return (
      <React.Fragment>
        <input
          type="text"
          placeholder="Class"
          id="myInput"
          onChange={this.myChangeHandler}
        />
        <form id="form" onsubmit="">
          <p>
            <i>
              {" "}
              <input
                type="text"
                className="input"
                placeholder="Class"
                id="classInput"
              />
            </i>
            <i>
              <input
                type="text"
                className="input"
                placeholder="Search..."
                id="searchInput"
              />{" "}
            </i>
          </p>
          <input type="submit" onclick="cname();" />
        </form>
      </React.Fragment>
    );
  }
}

export default Search;

function cname() {
  var cinput = document.getElementById("classInput").value;
  alert("dscdscdscdscs");
}

function sname() {
  var sinput = document.getElementById("searchInput").value;
  alert(sinput);
}
